INSERT INTO `wiki_game_dlc` VALUES
(1,20504,20,12500,'2009-08-03',0,NULL,'2009-07-14 12:54:54','2017-02-27 03:25:27','Mothership Zeta',NULL,'The final DLC for Fallout 3 has a 50s sci-fi vibe to it with early screens depicting UFOs. It will partially take place in outer space.','','','',0,NULL,0),
(2,20504,20,12501,'2009-01-27',0,NULL,'2009-07-14 16:26:23','2017-02-27 03:25:27','Operation: Anchorage',NULL,'An add-on featuring a virtual simulation of the liberation of Anchorage, Alaska from the Chinese Communist invaders. The simulation is a \"what if\" scenario, created by the United States Government in order to test different counter-offensives against the Chinese. In the simulation the player will have to secure a mountainside and fight his/her way into a Chinese base. The add-on mainly focuses on the combat/stealth paths and gives the player new tools to use. The mission takes about four to five hours for t','','','',0,NULL,0),
(3,20504,20,12502,'2009-03-29',0,NULL,'2009-07-14 16:31:18','2017-02-27 03:25:27','The Pitt',NULL,'The Pitt is the second downloadable add-on for Fallout 3 and allows your character to visit a ravaged Pittsburgh, Pennsylvania.','','','',0,NULL,0),
(4,20504,20,12503,'2009-05-05',0,NULL,'2009-07-14 16:34:21','2017-02-27 03:25:27','Broken Steel',NULL,'Broken Steel gives the player more missions to complete for the Brotherhood of Steel, as well as new weapons and armor. But most importantly, it removes the definite end of of Fallout 3 and raises the level cap to 30.','','','',0,NULL,0),
(5,20504,20,12504,'2009-06-23',0,NULL,'2009-07-14 16:37:23','2017-02-27 03:25:27','Point Lookout',NULL,'The Point Lookout DLC for Fallout 3 takes place in Point Lookout, MD. which is now a swampy wasteland inhabited by \"swamp folk\".','','','',0,NULL,0),
(6,20457,20,12505,'2009-02-17',0,NULL,'2009-07-14 17:10:49','2010-12-13 18:49:45','The Lost & Damned',NULL,'The first downloadable add-on for Grand Theft Auto IV puts players in the role of a biker named Johnny Klebitz.','','','',0,NULL,0),
(7,20457,20,12506,'2009-10-29',0,NULL,'2009-07-14 17:14:07','2012-12-11 03:00:00','The Ballad of Gay Tony',NULL,'The Ballad of Gay Tony is the second downloadable episode for Grand Theft Auto IV where the player takes on the role of club manager, Luis Lopez.','','','',0,NULL,0),
(8,20238,20,12507,'2006-04-03',0,NULL,'2009-07-14 17:20:30','2009-08-22 08:52:35','Horse Armor Pack',NULL,'Adds armor that you can purchase for your horse to protect it.','','','',0,NULL,0),
(9,20714,20,12508,'2009-07-14',0,NULL,'2009-07-14 17:26:23','2009-07-17 14:42:04','Third Man Records - The Dead Weather Pack 01',NULL,'Three songs from The Dead Weather: \"Hang You From The Heavens\", \"No Hassle Night\", \"Treat Me Like Your Mother\"','','','',0,NULL,0),
(10,20678,20,12509,'2008-10-23',0,NULL,'2009-07-14 17:37:11','2022-05-21 22:27:39','Additional Character: Darth Vader',NULL,'Unlock Darth Vader, a character that was previously exclusive to PS3 copies of the game.','','','',0,NULL,0),
(11,16909,20,12510,'2008-03-05',0,NULL,'2009-07-14 17:39:06','2013-02-13 11:38:27','Bring Down The Sky',NULL,'In this 253mb downloadable content pack, Shepard and his team are inserted onto a new asteroid and tasked with stopping it from colliding with a planet. It provides about 90 minutes of gameplay.','','','',0,NULL,0),
(12,20601,35,12511,'2009-07-23',0,NULL,'2009-07-14 17:48:41','2009-07-25 04:19:35','Napalm & Cordite Pack',NULL,'This third pack for Killzone 2 adds two maps called Suljeva Cliffside and Arctower Landing and the multiplayer-only weapons Flamethrower and Boltgun. As well as 7 trophies that can only be achieved with this DLC.','','','',0,NULL,0),
(13,20601,35,12512,'2009-04-30',0,NULL,'2009-07-14 17:53:39','2009-07-25 04:19:35','Steel & Titanium Pack',NULL,'Steel & Titanium is a multiplayer map pack for Killzone 2, adding two new maps called Wasteland Bullet and Vekta Cruiser. As well as 12 trophies that can only be achieved with this DLC.','','','',0,NULL,0),
(14,20601,35,12513,'2009-06-11',0,NULL,'2009-07-14 17:56:40','2009-07-25 04:19:35','Flash & Thunder Pack',NULL,'Flash & Thunder brings two new multiplayer maps to Killzone 2, they are called Southern Hills and Beach Head. As well as 12 trophies that can only be achieved with this DLC.','','','',0,NULL,0),
(15,21768,20,12514,'2009-06-25',0,NULL,'2009-07-14 18:17:22','2009-07-14 18:31:39','Unlimited Ragna Unlocked',NULL,'You can unlock Unlimited Ragna by simply beating arcade mode with Ragna, but if that\'s too much for you, you can just slide someone a dollar, too.','','','',0,NULL,0),
(16,20521,20,12515,'2009-07-21',0,NULL,'2009-07-14 18:34:55','2011-01-27 13:39:37','Historic Battle',NULL,'This pack adds four new maps and four new achievements to Halo Wars\' multiplayer mode. These maps are as follows: Blood River – battle a single opponent over a treacherous natural chokepoint; Barrens – engage your enemy in the midst of the Flood; Memorial Basin – two vs. two team play in one of the bloodiest battles in Halo history; and Glacial Ravine -- three vs. three action as you fight to control a narrow corridor flanked by energy walls.','','','',0,NULL,0),
(17,9993,20,12516,'2007-12-11',0,NULL,'2009-07-14 18:36:30','2010-03-01 12:24:47','Heroic Map Pack',NULL,'Includes the maps Foundry, Rat\'s Nest, and Standoff. This map pack became free on March 25, 2008. This map pack was included on a separate disc with Halo 3: ODST, which released on September 22, 2009.','','','',0,NULL,0),
(19,9993,20,12517,'2008-04-15',0,NULL,'2009-07-14 18:39:07','2010-03-01 12:25:03','Legendary Map Pack',NULL,'Includes the maps Avalanche, Blackout, and Ghost Town. Blackout is a remake of Halo 2 map, Lockout. This map pack\'s price was cut to $7.50 on July 7, 2008. Purchasing this map pack before the price cut gave you a free, four-month subscription to Bungie Pro. This map pack was included on a separate disc with Halo 3: ODST, which released on September 22, 2009.','','','',0,NULL,0),
(20,9993,20,12518,'2008-07-07',0,NULL,'2009-07-14 18:42:40','2010-03-01 12:25:19','Cold Storage',NULL,'A remake of the Halo: Combat Evolved map, Chill Out. The map launched free in celebration of Bungie Day 2008. This map was included on a separate disc with Halo 3: ODST, which released on September 22, 2009.','','','',0,NULL,0),
(21,20521,20,12519,'2009-05-19',0,NULL,'2009-07-14 18:47:57','2011-01-27 13:39:45','Halo Wars Strategic Options Add-on Pack',NULL,'This add-on brings new multiplayer rulesets to Halo Wars. The new rulesets are: Keepaway - capture the flag style game; Tug of War - who can field and maintain the strongest army; Reinforcements - adapt your tactics as you are granted waves of troops.','','','',0,NULL,0),
(22,9993,20,12520,'2009-04-09',0,NULL,'2009-07-14 18:48:30','2010-03-01 12:28:00','Mythic Map Pack',NULL,'Includes the maps Assembly, Orbital, and Sandbox. This map pack was originally exclusive to owners of the collector\'s edition of Halo Wars, which released on March 3, 2009. This map pack was included on a separate disc with Halo 3: ODST, which released on September 22, 2009.','','','',0,NULL,0),
(23,20238,20,12521,'2006-11-21',0,NULL,'2009-07-14 19:08:38','2009-09-12 14:19:28','Knights of the Nine',NULL,'Collect all the \"Crusader Relics\"  and help of the Knights of the Nine to destroy the evil Ayleid King Umaril. ','','','',0,NULL,0),
