(26,2133,20,12524,'2008-04-04',0,NULL,'2009-07-14 19:29:42','2013-06-25 14:26:49','Variety Map Pack',NULL,'Includes new multiplayer maps: \"Broadcast\", \"Chinatown\", \"Creek\" and \"Killhouse\".','','','',0,NULL,0),
(27,7110,32,12525,'2007-04-17',0,NULL,'2009-07-14 19:34:17','2010-03-01 12:57:07','Blastacular Map Pack',NULL,'A multiplayer map pack that adds two new maps: Tombstone and Desolation. Both maps are remakes of Halo: Combat Evolved maps, Hang \'Em High and Derelict, respectively. This map pack became free on July 7, 2007.','','','',0,NULL,0),
