(31,20773,20,12529,'2008-09-10',0,NULL,'2009-07-14 20:58:03','2009-07-14 21:12:59','Level Pack #2',NULL,'Level Pack #2 adds 150 \"harder\" single player, 50 multiplayer race, and 25 multiplayer survival levels.','','','',0,NULL,0),
