(38,20626,20,12536,'2008-12-04',0,NULL,'2009-07-15 01:41:45','2009-10-02 11:08:54','Jedi Temple Mission Pack',NULL,'A new mission at the Jedi Temple on Coruscant and nine new character skins. The skins include Temple Exploration Gear, Cybernetic Reconstruction, Darth Maul, Qui-Gon Jinn, Mace Windu, Dark Stalker, Sith Training Gear, Lightsaber Training Droid, Combat Training Droid. The mission is a separate campaign. New players can access it directly and old players won\'t be able to use their save. Jedi Temple also adds 7 achievements and 220 points.','','','',0,NULL,0),
(39,20626,20,12537,'2008-12-04',0,NULL,'2009-07-15 01:44:41','2009-10-02 11:08:54','Character Pack 2',NULL,'A skin pack with ten new character skins. Includes: Republic Trooper, Tatooine Luke, Ben Kenobi, Jedi Master Plo Koon, Count Dooku, Jango Fett, C-3P0, Utility Combat Suit Apprentice, Animated-Style Apprentice, and Spirit Apprentice','','','',0,NULL,0),
(40,20626,20,12538,'2008-11-13',0,NULL,'2009-07-15 01:53:27','2009-10-02 11:08:54','Character Pack 1',NULL,'A skin pack including ten new skins. Includes: Jedi Knight Anakin Skywalker, Jedi Knight Obi-Wan Kenobi, Jedi Knight Luke Skywalker, Imperial Commando, Darth Sion, Ki-Adi-Mundi, Kit Fisto, Hooded Combat Gear, Sith Assassin, and General Starkiller','','','',0,NULL,0),
