(985,19273,20,13467,'2008-07-23',0,NULL,'2009-08-08 14:14:45','2009-08-08 14:14:45','Ace of Aces Mission 09',NULL,'Mission 09 is now available on the highest difficulty level, Ace of Aces. Penetrate the fleet\'s defenses and destroy the heavy command cruiser, Aigaion! New Counter-Charge System! Allied reinforcements are rewarded based on the number of enemies destroyed during the time limit. Call in Allied Support, and destroy the enemy! New enemy ECM reported! A detrimental effect on missile performance has been reported, but details remain scarce. Stay alert! *Campaign Mode, Mission 01 must be cleared, and Free Mission','','','',0,NULL,0),
(986,19273,20,13468,'2008-07-23',0,NULL,'2009-08-08 14:14:58','2011-05-28 17:46:22','Typhoon -THE IDOLMASTER MAKOTO-',NULL,'Typhoon, THE IDOLMASTER, Makoto Kikuchi Aircraft Now Available! The stars of the hit game THE IDOLMASTER make their Ace Combat debut! Eleventh up is the androgynous Makoto Kikuchi. She has a few faults, but her agility captures the hearts of all who gaze upon her! We can\'t wait to watch her dance through the skies! Once downloaded other player aircraft will also reflect the content of Aircraft , otherwise other player aircraft will appear as Emmerian colors.','','','',0,NULL,0),
(987,19273,20,13469,'2008-07-23',0,NULL,'2009-08-08 14:15:21','2011-05-28 17:47:12','A-10A -THE IDOLMASTER SP-',NULL,'A-10A ThunderBolt II, \"THE IDOLMASTER SP\" Aircraft Now Available! The stars of the hit game THE IDOLMASTER make their Ace Combat debut! Twelfth up is the staff of 765 Productions! This unusual aircraft from our friends at 765 Productions makes flying fun! We can\'t wait to take this baby for a test flight! Once downloaded other player aircraft will also reflect the content of Aircraft , otherwise other player aircraft will appear as Emmerian colors. ','','','',0,NULL,0),
(988,19273,20,13470,'2008-07-23',0,NULL,'2009-08-08 14:15:44','2011-05-28 17:48:09','Rafale M -ESPADA-',NULL,'Rafale M, Espada Aircraft Now Available! An aircraft used by the Espada Squadron from Ace Combat Zero. Although hindered by decreased speed performance, this fighter\'s turning ability has been improved to give it a dominant position in air combat. Fly circles around your enemies before striking the final blow! Once downloaded other player aircraft will also reflect the content of Aircraft , otherwise other player aircraft will appear as Emmerian colors.','','','',0,NULL,0),
