(1006,20504,94,13488,'2009-01-27',0,NULL,'2009-08-10 07:23:18','2013-09-08 03:03:34','Operation: Anchorage',NULL,'The first PC DLC for Fallout 3. This is from the events of the Battle of Anchorage. The Lone Wanderer must battle the frigid cold as a US Army solder in 2077 and fight for America\'s Freedom from the Chinese. The add-on mainly focuses on the combat/stealth paths and gives the player new tools to use. The mission takes about four to five hours for the player to complete. The player is able to access the simulation via a new quest and map marker. It is accessible at any level, as soon as the player has left Va','','','',0,NULL,0),
(1007,20504,94,13489,'2009-08-03',0,NULL,'2009-08-10 07:23:40','2013-09-08 03:03:34','Mothership Zeta',NULL,'The 5th and final DLC (?) for PC came out one day earlier than previous DLC (a Monday rather than Tuesday). A weird signal is picked up by the Lone Wanderer. When you investigate, you discover a crashed alien ship and are quickly abducted. Upon your arrival on your ship, you have one thing left to do - get back to Earth!','','','',0,NULL,0),
(1008,20504,94,13490,'2009-06-23',0,NULL,'2009-08-10 07:23:41','2013-09-08 03:03:34','Point Lookout',NULL,'The 4th DLC for PC for Fallout 3. This time, similar to the Pitt - you leave the Wasteland to Point Lookout, Maryland. Encounter weird cults and new types of irradiated people. Plenty of new weapons and quests to complete. ','','','',0,NULL,0),
(1009,20504,94,13491,'2009-05-05',0,NULL,'2009-08-10 07:23:41','2013-09-08 03:03:34','Broken Steel',NULL,'The 3rd DLC for PC is the most essential DLC to get as it changes the original \"end-game\" for Fallout 3 to not end. Now you get to work with the Brotherhood of Steel to purge the Enclave from the Wastes once and for all! Additionally you can level from 20 (original cap) to 30 (new cap).','','','',0,NULL,0),
(1010,20504,94,13492,'2009-03-31',0,NULL,'2009-08-10 07:23:41','2013-09-08 03:03:34','The Pitt',NULL,'The 2nd PC DLC for Fallout 3. This time, takes you to the slave town of Pittsburgh, PA - also known as THE PITT. When you arrive, you quickly learn why that nickname has been given. Will you be the savior or the destroyer of the town?','','','',0,NULL,0),
