(1523,24995,20,14002,'2009-10-27',0,NULL,'2009-10-09 11:10:37','2010-03-24 12:39:17','Legends Car & Track Pack',NULL,'10 Cars, \'65 Alfa Romeo Giulia Sprint GTA, \'64 Aston Martin DB5 Vantage, \'81 BMW M1, \'60 Chevrolet Corvette, \'69 Dodge Charger, \'57 Ferrari 250 Testa Rossa, \'80 Fiat 131 Abarth, \'67 Lamborghini Miura P400, \'71 Nissan Skyline 2000 GT-R and \'65 Shelby Cobra Daytona Coupe. Two Tracks, Benchmark High Speed Ring and Sidewinder Proving Grounds.','','','',0,NULL,0),
(1524,20738,20,14003,'2009-11-03',0,NULL,'2009-10-11 05:46:02','2010-05-21 23:17:32','The Stone Prisoner',NULL,'The darkspawn-infested village of Honnleath holds a secret: the forgotten stone figure at the town\'s heart is a powerful golem frozen in time. the creature and reveal a storied quest to unlock its power and mysterious past.\n\nNOTE:  Retail copies come with an EA code (not Microsoft code) to redeem this add-on free of charge.  Code expires April 30, 2010.','','','',0,NULL,0),
(1525,20738,20,14004,'2009-11-03',0,NULL,'2009-10-11 05:51:19','2010-05-21 23:23:28','Warden\'s Keep',NULL,'This DLC explores the lore of the Grey Wardens. Within this quest into the Grey Warden\'s past, the player can discover new items, talents, spells, and even a base that comes along with it a place to store items.\n','','','',0,NULL,0),
(1526,20738,94,14005,'2009-11-03',0,NULL,'2009-10-12 16:56:18','2010-07-04 15:40:34','The Stone Prisoner',NULL,'Every new retail version of DA:O comes with a promotional code that can be redeemed to receive this DLC for free.\n\nThe DLC contains Shale, a stone golem who has a rich story, extensive back story and his own quest arc. Along with the new companion, the DLC comes with new items, environments and hours of new gameplay that enriches the Dragon Age campaign.','','','',0,NULL,0),
