(1835,20679,35,14312,'2009-05-28',0,NULL,'2010-05-08 08:14:00','2010-05-08 08:14:00','Corporate Warfare',NULL,'Corporate Warfare is the second piece of Saints Row 2 DLC, and contains new vehicles and clothing. The pack additionaly contains two new missions, and revolves around the search for Dex. The pack also adds some new online maps, and a single trophy.\n\nThe pack weighs in at 121MB. Clothing contained was selected due to community input, and amongst the options, gives the choice of purchasing the Ronin Jacket, or a Bandana.','','','',0,NULL,0),
