(1837,20679,20,14314,'2009-04-23',0,NULL,'2010-05-08 08:19:29','2011-03-21 22:26:40','Ultor Exposed',NULL,'Ultor Exposed was the first episode of DLC for Saints Row 2, and is based around the Saints\' drive to destroy the Ultor Corporation. The group receive help from one of the ex-Ultor workers, Tera Patrick (an adult movie actress in real life), and they discover more of Ultor\'s even darker side.\n\nThe contents of the pack include new multiplayer maps, clothing, cars, and missions. Not only this, it includes two more achievements, adding an additional 55G to the experience.','','','',0,NULL,0),
(1838,20679,35,14315,'2009-04-23',0,NULL,'2010-05-08 08:26:35','2010-05-08 08:26:35','Ultor Exposed',NULL,'Ultor Exposed is the first DLC episode for Saints Row 2. Ultor Exposed is based around the drive to destroy the Ultor Corporation, and this drive is fueled with help from an ex-employee of the corporation - Tera Patrick. Tera is an adult move star, and plays herself in the game. The pack contains new maps, new clothes, missions, and vehicles.','','','',0,NULL,0),
