(2008,20690,94,14485,'2010-10-05',0,NULL,'2010-10-05 17:50:51','2010-10-05 17:50:51','The Sacrifice',NULL,'The Sacrifice adds a new campaign that links the end of the \"Blood Harvest\" campaign, with the original survivor\'s appearance in Left 4 Dead 2\'s \"The Passing\" DLC. The Sacrifice is fully playable in Campaign, Versus and Survival.','','','',0,NULL,0),
