(2010,27919,20,14487,'2010-11-02',0,NULL,'2010-10-13 10:46:15','2010-11-17 15:24:13','The Doors Greatest Hits: Rock Band Edition',NULL,'Twelve songs from The Doors, including: “Light My Fire,” “Riders on the Storm,” “Touch Me,” “Hello, I Love You,” “L.A. Woman,” “Love Her Madly,” “Love Me Two Times,” “Peace Frog,” “People Are Strange,” “Roadhouse Blues,” “Soul Kitchen,” and “The Crystal Ship.”','','','',0,NULL,0),
(2011,27919,20,14488,'2010-10-26',0,NULL,'2010-10-13 10:53:43','2010-11-06 05:24:06','The Doors RB3 FREE Launch Pack',NULL,'Three songs from the Doors, including: “Light My Fire,” “Riders on the Storm,” and “Touch Me.”  Songs include Pro Guitars/Bass.  This pack will no longer be available after Nov. 1.  The three songs in this pack are also part of The Doors Greatest Hits: Special edition pack.','','','',0,NULL,0),
(2013,26786,20,14489,'2010-11-30',0,NULL,'2010-10-14 06:48:24','2011-04-17 22:22:54','Noble Map Pack',NULL,'The fight for humanity continues on a galactic scale. From a frozen xeno-archaeology site harboring secrets centuries old to an orbital anchor defending the stars high above planet Reach to mysterious places far, far beyond, the Noble Map Pack injects three new explosive environments into the multiplayer battlefield, each designed to reinforce all of Halo: Reach\'s vital warfronts, from small scale engagements to massive Invasion battlegrounds.','','','',0,NULL,0),
(2014,20714,20,14490,'2010-10-19',0,NULL,'2010-10-15 07:08:08','2010-10-15 07:14:33','Stone Temple Pilots Pack 01',NULL,'Six songs from Stone Temple Pilots, including: “Big Empty,” “Crackerman,” “Creep,” “Dead & Bloated,” “Huckleberry Crumble,” and “Trippin’ on a Hole in a Paper Heart.”','','','',0,NULL,0),
(2015,20714,20,14491,'2010-10-19',0,NULL,'2010-10-15 07:09:03','2010-10-15 07:11:40','Jimmy Eat World Pack 02',NULL,'Three songs from Jimmy Eat World, including “Bleed American,” “My Best Theory,” and “Pain.”','','','',0,NULL,0),
(2016,20479,20,14492,'2008-06-12',0,NULL,'2010-10-22 17:51:19','2011-05-28 20:10:01','Veteran Map Pack presented by Pontiac ',NULL,'This pack features two additional co-op campaign maps and a new multiplayer This pack contains two new missions for the Army of Two experience, and can be experienced solo, or alongside a friend in co-op. One of the missions added takes place in Kiev, Ukraine, while the other presents an Alternative Ending to the game. ','','','',0,NULL,0),
