(2019,20626,20,14495,'2010-02-23',0,NULL,'2010-11-01 13:01:26','2012-10-21 15:50:34','Hoth Mission Pack',NULL,'The search for Luke Skywalker leads the Apprentice (\"Starkiller\") to the Rebel\'s hidden base on the ice planet, Hoth. Under orders by the Emperor to turn Skywalker to the dark side , Starkiller must infiltrate Echo Base and fight through Rebel forces,and enthrall skywalker to the dark side or the rebels will defeat the empire.','','','',0,NULL,0),
(2020,20626,35,14496,'2010-02-18',0,NULL,'2010-11-01 13:02:59','2012-02-01 01:31:07','Hoth Mission Pack',NULL,'The search for Luke Skywalker leads the Apprentice (\"Starkiller\") to the Rebel\'s hidden base on the ice planet, Hoth. Under orders by the Emperor to eliminate Skywalker, Starkiller must infiltrate Echo Base and fight through Rebel forces, while also encountering deadly, ferocious wampas. The fate of the galaxy hangs in the balance','','','',0,NULL,0),
