(2077,25187,20,14553,'2010-11-02',0,NULL,'2010-11-30 22:09:26','2010-12-01 12:37:34','Skills Pack - Ninja',NULL,'This DLC adds a Ninja outfit to the locker located in the safehouse bathroom. This DLC will unlock special attacks and animations for Katana, Magician, Broad, and Laser Swords. Chucks throwing speed and damage dealt with throwing weapons such as Nails, Plates, Gems, CDs, and the like are increased. Chuck will also be undetectable by zombies.','','','',0,NULL,0),
(2078,25187,20,14554,'2010-10-26',0,NULL,'2010-11-30 22:09:55','2010-12-01 12:37:14','Skills Pack - Sports Fan',NULL,'This DLC adds a sports fan outfit to the locker in the safehouse bathroom. When worn this outfit unlocks a unique animation and attack for the Football. Increases the effectiveness and damage of all sports related weapons. Gains an extra restore point of health from all foods consumed. Chuck will no longer vomit when too much alcohol is consumed. His running speed is increased. And he will receive an extra $100 from all gambling related wins.','','','',0,NULL,0),
(2079,25187,20,14555,'2010-10-19',0,NULL,'2010-11-30 22:11:01','2010-12-01 12:36:49','Skills Pack - Soldier',NULL,'This DLC adds a soldier of fortune outfit to the locker in the safehouse bathroom. When worn the soldier outfit will double the ammunition count of all firearms, increase accuracy for all firearms, increase the damage of each shot, and unlock a unique attack for the LMG.','','','',0,NULL,0),
(2080,25187,20,14556,'2010-10-12',0,NULL,'2010-11-30 22:11:35','2010-12-01 12:36:22','Skills Pack - Psycho',NULL,'This DLC adds a psychopath outfit to the locker in the safehouse bathroom. When worn the Psycho outfit will increase the damage for the Pitchfork; Power Drill; Chef Knife; Machete; Crowbar; Large Wrench; Cement Saw Chainsaw; Mining Pick; and Meat Cleaver. \n\nUnlock special attacks and animations for the Meat Cleaver, Mining Pick, and Machete. It will also reduce all damage Chuck receives from all attacks.','','','',0,NULL,0),
(2081,25187,35,14557,'2010-11-02',0,NULL,'2010-12-01 17:37:26','2010-12-01 17:44:56','Skills Pack - Ninja',NULL,'This DLC adds a Ninja outfit to the locker located in the safehouse bathroom. This DLC will unlock special attacks and animations for Katana, Magician, Broad, and Laser Swords. Chucks throwing speed and damage dealt with throwing weapons such as Nails, Plates, Gems, CDs, and the like are increased. Chuck will also be undetectable by zombies. ','','','',0,NULL,0),
(2082,25187,35,14558,'2010-10-26',0,NULL,'2010-12-01 17:38:45','2010-12-01 17:45:38','Skills Pack - Sports Fan',NULL,'	This DLC adds a sports fan outfit to the locker in the safehouse bathroom. When worn this outfit unlocks a unique animation and attack for the Football. Increases the effectiveness and damage of all sports related weapons. Gains an extra restore point of health from all foods consumed. Chuck will no longer vomit when too much alcohol is consumed. His running speed is increased. And he will receive an extra $100 from all gambling related wins.','','','',0,NULL,0),
