(2927,35892,94,15392,'2011-10-28',0,NULL,'2011-10-28 10:50:35','2011-10-28 10:50:35','Trains vs Zombies',NULL,'Trains vs Zombies brings a logical addition to the Railworks universe: zombies. Tasked with rescuing survivors of yet another video game zombie apocalypse with the power of trains, Trains vs Zombies adds four new scenarios to the core Railworks 3 game, as well as additional gameplay mechanics such as destructible train tracks and (most logically of all) flying trains in addition to the aforementioned undead. The train simulation genre has just seen its most realistic rendition yet!','','','',0,NULL,0),
