(3031,23311,94,15496,'2011-12-06',0,NULL,'2011-12-21 16:05:36','2011-12-21 16:05:36','Defense Grid: The Awakening - You Monster ',NULL,'In this first full-story expansion to the award-winning Defense Grid, GLaDOS, the menacing AI from Valve’s awesome Portal franchise, guest stars and shakes up the Defense Grid world. Players will battle not only alien hordes, but the deviousness of GLaDOS as she tests the player’s skills and changes all of the rules that you have come to know. Can you protect the cores in spite of her intrusive testing?\n\nDefense Grid: You Monster adds:\n\n8 new maps with an all new story.\n35 challenge missions.\n7 new achievem','','','',0,NULL,0),
(3032,21790,35,15497,'2011-12-20',0,NULL,'2011-12-21 18:34:36','2011-12-21 18:35:07','Gran Turismo 5: Car Pack 2',NULL,'Car Pack 2 includes 5 new cars: 2011 Mini Cooper S, 2010 Volkswagen Golf VI R, 2010 Volkswagen Scirocco R and 2012 Nissan GT-R Black edition R35.\n','','','',0,NULL,0),
(3033,34619,20,15498,NULL,0,NULL,'2011-12-26 14:48:56','2012-01-22 19:29:54','Coldstrike',NULL,'The Coldstrike campaign sees the Renegades go up against a new villain code named Coldstrike. General Bryant and his team must traverse vast arctic environments to help save innocent civilians and stop this latest threat by any means necessary!','','','',0,NULL,0),
(3034,34619,20,15499,NULL,0,NULL,'2011-12-26 14:49:25','2012-04-09 10:37:05','Reinforcement Vehicle Pack',NULL,'General Bryant has found two new recruits to help in the fight against Inferno; Blazemo and Crystal.\n','','','',0,NULL,0),
(3035,29021,35,15500,'2011-12-06',0,NULL,'2011-12-27 01:45:51','2011-12-27 01:45:51','Resistance 3: Brutality Pack',NULL,'The Resistance 3: Brutality Pack consists of a single survival mode for 1-2 players. It contains one map, and has players fighting endless waves of Grims, Leeches, and variations of the two. No Matchmaking included.\n\nThe pack also includes a multiplayer skin of Mick Cutler, a new Sledgehammer melee weapon, and a PSN theme. The Sledgehammer is also available for use in competitive multiplayer modes.','','','',0,NULL,0),
(3036,32982,35,15501,'2011-11-15',0,NULL,'2011-12-27 20:11:22','2011-12-27 20:17:21','Fortune Hunters’ Club',NULL,'A bundled Pre-Order type of DLC that earns the purchaser the first seven multiplayer packs (three character skin packs, four map packs) that will be released for UNCHARTED 3. This bundle is being described as a total savings of 45% off the price if one were to purchase all the packs separately. \n1. (3) Character Skin Packs\n2. (4) Map Packs\n3. (1) Fortune Hunters’ Club theme for XMB\n','','','',0,NULL,0),
(3037,32982,35,15502,'2011-11-15',0,NULL,'2011-12-27 20:16:06','2011-12-27 20:19:05','Killzone Skin Pack',NULL,'Killzone-themed multiplayer skin pack was released for Uncharted 3 via the Playstation Store. Members of the Fortune Hunters’ Club received this pack for no additional charge.\nIncludes: Complete \"Capture Trooper\" skin, and two helmets (ISA, and Helghast).','','','',0,NULL,0),
(3038,32982,35,15503,'2011-11-01',0,NULL,'2011-12-27 20:24:08','2011-12-27 20:27:55','Classic Skins Pack 1',NULL,'Classic Skins Pack 1 adds seven skins to Uncharted 3:\n-Drake UDF\n-Wetsuit Drake\n-Elena UDF\n-Gabriel Roman\n-Atoq Navarro\n-Eddy Raja\n-Prakoso','','','',0,NULL,0),
