(3209,33345,20,15674,'2012-07-24',0,NULL,'2012-05-08 12:08:14','2012-05-08 20:14:32','Excessive Force pack',NULL,'The Excessive Force dlc pack is the second dlc bundle to be released for Prototype 2. Like the first bundle, this one contains three skins: Armored Heller, Agile Armor Alex Mercer, and Zombie Alex Mercer. Also like the last pack, this one contains an ultimate weapon, in this case the Viral Infector grenade launcher, and three more force multipliers: Medusa\'s Wrath, Shock wave, and Chaos Creator mode.','','','',0,NULL,0),
(3210,33393,20,15675,'2012-04-03',0,NULL,'2012-05-08 17:45:38','2012-05-08 17:45:38','Boards & Riders Pack',NULL,'Adds SSX favorite Eddie Wachowksi and real-world pro snowboarder Travis Rice. Also includes level 6 Ultimate Snowboards for Eddie, Zoe, Mac, Kaori, and Elise.','','','',0,NULL,0),
