(3221,35899,94,15686,'2012-05-27',0,NULL,'2012-05-28 12:22:55','2012-05-31 09:26:03','Wrath of the Lamb',NULL,'The Binding of Isaac: Wrath of the Lamb is the expansion to The Binding of Isaac, a randomly generated action RPG shooter with heavy Rogue-like elements. Following Isaac on his journey players will find bizarre treasures that change Isaac’s form giving him super human abilities and enabling him to fight off droves of mysterious creatures, discover secrets and fight his way to safety.\n    \n*100+ new items! (now over 235 items!)\n*5+ new chapters!\n*20+ new enemies!\n*25 new achievements!\n*15+ new bosses!    \n*6','','','',0,NULL,0),
