(3396,18162,94,15860,'2010-12-17',0,NULL,'2012-08-15 14:32:36','2012-08-15 14:51:35','Australian Christmas',NULL,'Added Medievil Mode to Team Fortress 2, which restricted the players to melee-only or specific weapons.\nAdded Degroot Keep for the Medievil Mode.\nAdded new weapons for 6 of the classes.\nAdded three new weapon sets for the Medic, Heavy, and Demoman.\nAdded a Stamp Store where players could support community-made maps by purchasing stamps for the level.\nIncreased the backpack slots by 100.\nAdded 20 new hats.\nAdded special festive keys that were used to open festive crates.','','','',0,NULL,0),
(3397,18162,94,15861,'2011-12-16',0,NULL,'2012-08-15 14:34:54','2012-08-15 14:36:51','Australian Christmas 2011',NULL,'Added a new CP map called Foundry, which featured new hazards.\nAdded new weapons packs for the Engineer (Brainiac Pack) and the Pyro (Moonman Pack), as well as new weapons for the Heavy (Holiday Punch), Spy (Spycicle), and Scout (Wrap Assassin\nAdded 14 new community-created weapons and hats. \nAdded special Naughty and Nice Crates, which used special keys to open. All Naughty or Nice crates reverted back to standard crates on December 22nd.\n','','','',0,NULL,0),
(3398,18162,94,15862,'2012-06-27',0,NULL,'2012-08-15 17:25:06','2012-08-22 10:24:32','Pyromania',NULL,'Added the final \"Meet the...\" video for the Pyro.\nAdded the new Special Delivery CTF map Doomsday, in which RED and BLU compete to secure the neutral briefcase of Austraulium, deliver it to the rocket, and successfully launch it.\nAdded Pyrovision Goggles, which grants visual access to Pyroland, a child-like and colorful world that the Pyro sees through the lens of his Optical Mask. Given in \"Vintage\" form to all who logged on before July 5th.\nAdded Burning Bongos, Infernal Orchestrina, and Ballonicorn items','','','',0,NULL,0),
(3399,18162,94,15863,'2011-04-14',0,NULL,'2012-08-15 17:26:33','2012-08-15 17:28:25','The Hatless Update',NULL,'Added a new KotH map called Badlands.\nAdded a new \"Coach\" mechanic that allows seasoned players to coach those who are looking for some assistance with TF2.\nAdded the Spy, Demoman, and Engineer to the in-game Basic Training mode.\nAdded a new UI for voting.\nAdded a new Dynamic Model Loading patch that allows TF2 to use less memory when in use.\nAdded new SLIK Audio Codec to improve voice chat in-game.\nPlayers running TF2 with DX8 can now see paints.\nAdded ability for in-game bots to play Payload and improved ','','','',0,NULL,0),
(3400,18162,94,15864,'2010-10-28',0,NULL,'2012-08-15 17:27:05','2012-08-20 21:19:51','The Second Annu-Hell Scream Fortress Hauntdead Halloween Special',NULL,'Added the winners of the TF2Maps.net contest: Mountain Lab and Mann Manor to Team Fortress 2.\nAdded new special Halloween-only achievements.\nAdded the Horseless Headless Horseman, the first ever \"official\" boss for Team Fortress 2, to the Mann Manor map.\nAdded Description Tags, which allow players to add custom descriptions to the weapons of their choice.\nAdded the option to have items gift-wrapped when bought. \nAdded the Sticky Jumper, a new Demoman weapon that deals no damage and is designed to help train','','','',0,NULL,0),
(3401,18162,94,15865,'2010-08-12',0,NULL,'2012-08-15 18:50:37','2012-08-15 18:56:05','The Mac/Offline Mode Update',NULL,'Added iMac compatibility to Team Fortress 2.\nAdded new Training Mode, which allowed players to partake in basic training.\nAdded new Offline Practice Mode, which pits the player in a offline match against A.I. controlled bots in select game modes.\nAdded simplified menus for easier access.\nPlayers who played Team Fortress 2 on the iMac within four days of it\'s release were given free white earbuds that can be equipped in-game.','','','',0,NULL,0),
(3402,18162,94,15866,'2012-08-15',0,NULL,'2012-08-15 18:51:02','2014-10-30 10:33:51','Mann vs Machine Update',NULL,'Added a Six Player Co-op, the first ever of it\'s kind, to Team Fortress 2.\nAdded a new, robotic faction known as the Gray Horde for use in Co-op Mode.\nAdded new Co-op maps: Mannworks, Coal Town, and Decoy.\nAdded the Upgrade Station to the Co-op Mode, which allows players to upgrade their arsenal in the downtime between each wave.\nAdded Mann Up mode, a pay-to-play mode that grants access to rare loot and cosmetic items.\nAdded Tactical Options for each character, allowing for dynamic tactical advantages on th','','','',0,NULL,0),
